import React from "react";
import myImage from "../img/portfolio.jpg"

class About extends React.Component {
  constructor() {
    super();
    this.state = {
      skills: [
        { id: "HTML/CSS_skill", content: "HTML/CSS", porcentage: "60%", value: "60" },
        {
          id: "JavaScript_skill",
          content: "JavaScript",
          porcentage: "90%",
          value: "90"
        },
        { id: "PHP_skill", content: "PHP", porcentage: "70%", value: "70" },
        {
          id: "ReactJS_skill",
          content: "ReactJS",
          porcentage: "80%",
          value: "80"
        },
        {
          id: "Python_skill",
          content: "Python",
          porcentage: "80%",
          value: "80"
        },
        {
          id: "VanillaJS_skill",
          content: "VanillaJS",
          porcentage: "85%",
          value: "85"
        },
        {
          id: "Wordpress_skill",
          content: "Wordpress",
          porcentage: "80%",
          value: "80"
        }
      ],
      about_me: [
        {
          id: "first-p-about",
          content:
            "Hello! I'm a Computer Science and Economics double major at Vanderbilt University with a passion for full-stack development and exploring the vast potential of cloud computing. While my current focus involves developing full-stack research applications, I'm also intrigued by learning how technological innovation and economic principles intersect and influence each other. I'm eager to apply my interdisciplinary knowledge to create innovative solutions and continue growing my expertise."
        },
        // {
        //   id: "second-p-about",
        //   content:
        //     "Lorem ipsum pariatur consectetur laboris occaecat nulla aliqua irure ad deserunt duis. Eiusmod nulla cupidatat labore sint sit aute dolore irure nostrud ut incididunt. Anim laborum reprehenderit labore magna ut dolore quis irure. Labore ea duis deserunt ullamco irure fugiat deserunt ut nisi ea minim proident. Nisi consectetur do non magna duis aliqua minim minim veniam. In occaecat minim qui consequat elit mollit consectetur non id tempor. Amet adipisicing occaecat tempor culpa quis est duis."
        // },
        // {
        //   id: "third-p-about",
        //   content:
        //     "Lorem ipsum pariatur consectetur laboris occaecat nulla aliqua irure ad deserunt duis. Eiusmod nulla cupidatat labore sint sit aute dolore irure nostrud ut incididunt. Anim laborum reprehenderit labore magna ut dolore quis irure. Labore ea duis deserunt ullamco irure fugiat deserunt ut nisi ea minim proident. Nisi consectetur do non magna duis aliqua minim minim veniam. In occaecat minim qui consequat elit mollit consectetur non id tempor. Amet adipisicing occaecat tempor culpa quis est duis."
        // }
      ]
    };
  }

  render() {
    return (
<section id="about" className="about-mf sect-pt4 route">
  <div className="container">
    <div className="row">
      <div className="col-sm-12">
        <div className="box-shadow-full">
          <div className="row">
            {/* Image on the left */}
            <div className="col-md-4">
              <div className="about-img" style={{ textAlign: "center" }}>
                <img
                  className="img-fluid rounded b-shadow-a"
                  src={myImage}
                  alt="Hua Jin"
                />
              </div>
            </div>

            {/* About Me text on the right */}
            <div className="col-md-8">
              <div className="about-me">
                <div className="title-box-2">
                  <h5 className="title-left">About Me</h5>
                </div>
                {this.state.about_me.map(content => {
                  return (
                    <p className="lead" key={content.id}>
                      {content.content}
                    </p>
                  );
                })}
              </div>
            </div>
          </div>

          {/* Skills section below */}
          <div className="row mt-4">
            <div className="col-md-12">
              <div className="skill-mf">
                <p className="title-s">Skills</p>
                {this.state.skills.map(skill => {
                  return (
                    <React.Fragment key={skill.id}>
                      <span>{skill.content}</span>{" "}
                      <span className="pull-right">
                        {skill.porcentage}
                      </span>
                      <div className="progress">
                        <div
                          className="progress-bar"
                          role="progressbar"
                          style={{ width: skill.porcentage }}
                          aria-valuenow={skill.value}
                          aria-valuemin="0"
                          aria-valuemax="100"
                        ></div>
                      </div>
                    </React.Fragment>
                  );
                })}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
</section>
    );
  }
}

export default About;
